<script>
export default {
	data()
      {
          return{
              authUser: [],
			  role_id: '',           
          }
      },
	mounted()
	{
		this.getLoggedUser();
	},
	methods: {
		getLoggedUser() {
			
            this.authUser = localStorage.getItem( 'authUser' );
			var jsonData = JSON.parse(this.authUser);
			this.role_id = jsonData.role_id;
			
			
			},
		logout(){
				axios.post('/api/admin/logout').then((res)=>{
					// const authUser = JSON.parse(localStorage.getItem('authUser'));
					// if(authUser)
					// {
					// 	localStorage.removeItem('authUser');
					// }
					localStorage.removeItem('authUser');
					this.flashMessage.success({
					message: 'Logout successfully',                            
					});
					this.$router.push("/login");
			});
		},
		redirect(type)
		{
			let self = this;			
			if(type == 'home')
			{
				$('.loaderBck').show();
				setTimeout(function(){
					$('.loaderBck').hide();
					self.$router.push("/");
				}, 2000);
			}
			else if(type == 'pricing')
			{
				$('.loaderBck').show();
				setTimeout(function(){
					$('.loaderBck').hide();
					self.$router.push("/pricing");
				}, 2000);
			}
			else if(type == 'employer')
			{
				$('.loaderBck').show();
				setTimeout(function(){
					$('.loaderBck').hide();
					window.location.replace('/employer/index')
				}, 2000);
			}
			else if(type == '/employer/pricing')
			{
				$('.loaderBck').show();
				setTimeout(function(){
					$('.loaderBck').hide();
					window.location.replace('/employer/pricing')
				}, 2000);
			}
			else if(type == 'admin')
			{
				$('.loaderBck').show();
				setTimeout(function(){
					$('.loaderBck').hide();
					window.location.replace('/admin/dashboard')
				}, 2000);
			}
			
			
		},
		
	},
	
}
</script>